import React, { useState, useEffect } from 'react';
import { useSelector } from 'react-redux';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import HomeScreen from './../Screens/Home';
import Login from "../Components/Login/index"
import SignUpComponents from "../Components/Signup"
import ForgetComponents from "../Components/ForgetPassword"
import ResetComponents from "../Components/Resetpassword"
import VerifyOtpComponents from "../Components/VerifyOtp"
import NotFound from "./../../Error"

 export const currentURL = '/projects/suvendu/robins/mondongo';

//  basename={currentURL}

function RouterScreen(){


    return (

        <Router>
            <div>
                        <Switch >
                          <Route exact  path='/' component={Login} />
                           <Route path='/signup' component={SignUpComponents} />
                           <Route path='/forgetpassword' component={ForgetComponents} />
                           <Route path='/resetpassword' component={ResetComponents} />
                           <Route path='/verifyotp' component={VerifyOtpComponents} />
                           <Route path='/home' component={HomeScreen}  />
                            <Route component={NotFound} />
                        </Switch >

            </div>
        </Router>
    );
}

export default RouterScreen;
